import React from "react";
import "./App.scss";
import Users from "./Users";

function App() {
  const [userId, setUserId] = React.useState("0");
  return (
    <React.Fragment>
      <Users setUserId={setUserId} />
      {userId}
    </React.Fragment>
  );
}

export default App;
